import React, { Component } from "react";
import CartLayout from './CartLayout'
import Title from '../Title'

export default class ShoppingCart extends Component {
  render() {
    return (
    <section>
      <Title name="" title=" cart"></Title>
      <CartLayout></CartLayout>
    </section>
    );
  }
}
